import Tabs from "./tabs";
import tabsSchema from "./tabs.schema";
export { tabsSchema };
export default Tabs;
export * from "./tabs";
import Tab from "./tab";
import tabSchema from "./tab.schema";
export { Tab, tabSchema };
export * from "./tab";
import TabItem from "./tab-item";
import tabItemSchema from "./tab-item.schema";
export { TabItem, tabItemSchema };
export * from "./tab-item";
import TabPanel from "./tab-panel";
import tabPanelSchema from "./tab-panel.schema";
export { TabPanel, tabPanelSchema };
export * from "./tab-panel";
